Y OMAR, EN PRINCIPIO HA DICHO QUE ES UNA PACA DE CEMENTO Y NO DOS COMO LO MANIFIESTA EL PERIDICO Y EL PROCESO SE ADELANTA EN EL JUZGADO PRIMERO PROMISCUO MPAL DEL VILLA DEL ROSARIO POR LA DRA. ESTELA.', 'PENAL', '1. LA POLICA DE VILLA DEL ROSARIO INFORM A LA FAMILIA QUE PEDRO JESS LO CAPTURARON DENTRO DE UNA CASA CUANDO EN REALIDAD LO CAPTURARON FRENTE AL TEMPLO CATLICO CRISTO REY.
