INSERT INTO "personacaso" VALUES ('1549', '25/06/2012', '17:02:41', 'ANGEL MARIA', 'BARRERA ', 'MASCULINO', '80', 'COLOMBIANA', '2119682', 'CC', 'CUCUTA', 'NO POSEE', '', '', 'CARRERA 6 NO. 2-01 LA PARADA', '3204388324', 'No POSEE', 'SI', 'DOS', 'NO', '', 'NO', '', 'PRIMARIA', '', 'NO POSEE', 'RIGIDA', '0', 'SOLTERO', '', 'DIANA CAROLINA BARRERA', '5701291', 'CRA 6 NO. 2-01', '3118135242', 'EL USUARIO', 'EL USUARIO', '0', 'NUNCA', 'NINGUNO', 'NINGUNO', 'CASA', 'ARRENDADA', 'Agua', 'Luz', 'Alcantarillado', 'Alumbrado Publico', 'Telefono', 'null', 'NO POSEE', 'NO', '000', 'NO', '', 'NO POSEE', 'null', 'null', 'null', 'null', 'NO POSEE', 'NO', '', '', '', '', '', '', '', 'NO', '', '', '', '', 'EL SEOR VENDIO SU VIVIENDA UBICADA EN LA CARRERA 4, EN EL 2008, ADEMAS DE ELLO EL DINERO FUE DESIGNADO PARA COMPRAR OTRA CASA, EL SEOR FUE QUIEN REALIZO DICHO NEGOCIO, ENTREGO A LA SEORA MARIA EUGENIA BAUTISTA SERRANO EL DINERO, PERO AL MOMENTO DE LA FIRMA DE LA ESCRITURA PUBLICA NO FUE EL SEOR ANGEL MARIA BARRERA, SINO QUE DESIGNO A SU HIJO, PERO EN EL MOMETNO DE LA FIRMA CONCURRIO SU HIJA A FIRMAR, POR ENDE LA ESCRITURA PUBLICA QUEDO A NOMBRE DE LOS HIJOS DEL SEOR, UNO DE ELLOS NO TIENE PROBLEMA EN VOLVER HACER LOA ESCRITURA PUBLICA, PERO LA OTRA HIJA DEL SEOR PIDE UNA CANTIDAD DE DINERO POR VOLVER HACER LAS ESCRITURAS DE LA CASA A NOMBRE DEL SEOR ANGEL MARIA BARRERA; ADEMAS EL SEOR ANGEL MARIA HA EJERCIDO EL PAPEL DE3 POSEEDOR MATERIAL DE LA VIVIENDA, LA CUAL POR MANIPULACION DE UNA DE SUS HIJAS NO APARECE A NOMBRE DE L. ', 'PRIVADA', 'EL SEOR QUIERE QUE SE CONCILIE, SE CITE A SU HIJA Y SE MODIFIQUE LA ESCRITURA PUBLICA, EL DEJA CLARO, QUE SIEMPRE DESDE EL MOMENTO QUE SE CELEBRO EL NEGOCIO, AUNQUE EL NO APAREZCA LA ESCRITURA PUBLICA, EL EJERCE LAS SIGUIENTES FUNCIONES COMO POSEEDOR MATERIAL, EL ARRIENDA ESA CASA A TRAVES DE UNA ARRENDADORA QUE MANEJA EL ABOGADO MILTON CARREO.', 'FOTOCOPIA DE LA CEDULA DE CIUDADANIA
